function click() {
  $('#designer-toolbar-item-sync').tooltip('hide');
  var DialogSync = this.require('DialogSync');

  DialogSync = new DialogSync({
      'title': 'Github'
  });
  DialogSync.show();
  DialogSync.on('ok', function () {
    if ($('#designer-dialog-sync-refresh').prop('checked')) {
      this.require('github').refresh();
    } else {
      this.require('github').push(
        $('#designer-dialog-sync-comments').val(), 
        $('#designer-dialog-type-creation-hasHTML').prop('checked'), 
        false, 
        $('#designer-dialog-sync-options-log-level-select').val(), 
        $('#designer-dialog-type-creation-hasPackage').prop('checked')
      );
    }
    this.hide();
  });
}
